import IConfirmMainScreen from "../../../models/IConfirmMainScreen";

const ConfirmMainScreenPTBR: IConfirmMainScreen = {
    title: "Deseja criar uma conta?",
    subTitle: "Olá, você ainda não possuí cadastro {brand} com e-mail {email}",
    linkChangeEmail: "Alterar e-mail",
    createAccountButton: "CRIAR CONTA"
};

export default ConfirmMainScreenPTBR;
